// shop.jsx
import React from 'react';
import Layout from '../components/Layout';

const Shop = () => {
  return (
    <Layout>
      <h2 style={{ textAlign: 'center', margin: '2rem 0', color: '#fff' }}>Shop</h2>
      <p style={{ textAlign: 'center', color: '#ccc' }}>
        Découvrez nos produits et offres exclusives, soigneusement sélectionnés pour compléter cette expérience sacrée.
      </p>
    </Layout>
  );
};

export default Shop;
